class Solution:
    def isAnagram(self, s, t):
        # return sorted(s) == sorted(t)
        checked = []
        for ch in s:
            if s.count(ch) != t.count(ch):
                return False
        return True


    def findAnagrams(self, s, p):
        p_len = len(p)
        s_len = len(s)
        i = 0
        anagrams_indexes = []
        if p_len == s_len:
            if self.isAnagram(s,p):
                anagrams_indexes.append(0)
            return anagrams_indexes
        while i < s_len:
            if p_len+i <= s_len:
                if self.isAnagram(p, s[i:p_len + i]):
                    anagrams_indexes.append(i)
            i +=1
        return anagrams_indexes
